const NotFound = ()=>{

    return(
        <div className="container mx-auto flex items-center gap-3 flex-col text-center">
            <h2 className="text-7xl font-bold">Oops!</h2>
            <p>404 - Page Not Found!</p>
            <button className="p-3 bg-purple-600 rounded w-[15%]">
                <i class="fas fa-home pr-2"></i>
                BACK TO HOME
            </button>
        </div>
    )
}

export default NotFound
